(()=>{const e=document.getElementById("is-ticket-types-panel");if(e){const t=e.querySelectorAll(".panel-tabs a"),s=e=>{e.preventDefault(),t.forEach(e=>{e.classList.remove("is-active")});const s=e.currentTarget;s.classList.add("is-active"),document.getElementById("ticketTypesTabPanel--summary").classList.add("is-hidden"),document.getElementById("ticketTypesTabPanel--log").classList.add("is-hidden"),document.getElementById(s.getAttribute("aria-controls")).classList.remove("is-hidden")};t.forEach(e=>{e.addEventListener("click",s)})}})();